INSERT INTO `gioco` VALUES (1,'Rise of Knights',950,9,'Zoom infinito, battaglie realistiche, possibilità\nillimitate. La strategia live qui!\n13 Civiltà, 68 Eroi, Guerre Reali','2012-06-18',NULL,'28884160640'),(2,'Biliardo',136.5,4,'Il gioco di biliardo numero 1 al mondo\nGioca con gli amici! Gioca con le leggende. Gioca\nil grandissimo gioco 8 Ball Pool di Miniclip sul tuo\ndispositivo portatile e diventa il migliore!','2011-05-18',0.99,'34517460522'),(3,'Real Boxing',700,12,'Combatti in una nuova esperienza di Boxing mai vista fino ad ora','2010-10-22',2.99,'36603780721'),(4,'Tennis Pro',248.3,12,'Hai una passione per il tennis? Allora preparati a una straordinaria esperienza tennistica su dispositivi mobili!','2013-05-23',NULL,'43924520364'),(5,'Super Wars',899.9,12,'Top War è un gioco di strategia innovativo con\nfunzione di sintesi, senza lunghi periodi di attesa\nper i potenziamenti!','2014-01-14',3,'46929700857'),(6,'Car Racing',809.4,4,'Colleziona, personalizza e potenzia una vasta\ngamma di auto di marca in Rebel Racing.\nC\'è un confine molto sottile tra essere veloci e arrivare primi..','2015-11-10',NULL,'54466660021'),(7,'Sudoku',113,4,'l Sudoku ti fa pensare! Sudoku, il nostro gioco di enigmistica completamente gratuito, Ogni giorno avrai a tua disposizione oltre 5.000 schemi di Sudoku per allenare la tua mente','2015-02-11',0.99,'54618600669'),(8,'Quiz amici',289.2,4,'Divertiti sfidando i tuoi amici e i tuoi nemici nel gioco a quiz del momento!','2015-11-13',NULL,'59964530824'),(9,'ultimate football',200.5,4,'Sei pronto a una sfida calcistica mai vista prima? Gioca come attaccante e come portiere in adrenalinici faccia a faccia contro i tuoi amici o giocatori da tutto il mondo!','2014-09-17',0.49,'61415450974'),(10,'Peschiamo!',495.7,12,'Volevi catturare un pesce, ma non riuscivi a raggiungere le tue zone di pesca preferite? I soliti giochi di pesca ti annoiavano? Gioca a Fishing Clash','2015-04-15',NULL,'62363710891'),(11,'Basket 2.0',419.8,4,'Il gioco di pallacanestro definitivo. Indossa le scarpe e preparati a scendere in campo in questo nuovissimo gioco di pallacanestro!','2013-03-05',1.49,'76725520993'),(12,'Riders',243.9,4,'Sei al volante di una moto in un\'esperienza di gioco molto più dettagliata, ma che conserva anche il divertimento e la semplicità della vecchia scuola.','2015-10-31',2.49,'34517460522'),(13,'The Escape',238.9,4,'Fuggi dalla nuovissima serie di località, pieno di puzzle complessi e una nuova fantastica ambientazione tutta da esplorare.','2014-02-03',NULL,'36603780721'),(14,'The Parking',345.9,12,'Tira il freno! Sei bloccato in un parcheggio! È ora di andare, ma tutte le altre auto ti intralciano! Devi spostarle... ma attento!','2015-01-24',0.99,'34517460522'),(15,'The golf battle',161.8,4,'Sfida giocatori reali da tutto il mondo e raggiungi il top.\nRaduna i tuoi amici e gioca 1 contro 1 o fino a 6 amici tutti insieme.\nControlli super facili. Gameplay divertente e intuitivo.','2014-09-17',NULL,'43924520364'),(16,'Samurais',309.8,12,'Samurais ti trasporterà nel Giappone medievale. Nel gioco ottieni battaglie tattiche di spada samurai, avversari intelligenti, tutti i tipi di equipaggiamento, numerose posizioni.','2014-06-03',1.59,'43924520364'),(17,'Cruciverba',24.5,17,'Attenzione fan dei cruciverba! Con la nuova app per cruciverba, sarà difficile annoiarsi! Cruciverba a portata di mano, ovunque tu vada.','2013-08-15',NULL,'54618600669'),(18,'Indovina il disegno',215.4,9,'Indovina cosa è stato disegnato per battere i tuoi nemici','2015-07-18',2.29,'54618600669'),(19,'Il Dentista',151.2,12,'Fare i dentisti non è mai stato così divertente... e rilassante! Cura i tuoi pazienti, ottura le carie, rimuovi la placca. Estrai i denti cariati e sostituiscili con denti nuovi e splendenti.','2014-04-26',NULL,'34517460522'),(20,'Cucina la pizza!',121.3,4,'Fare la pizza non è mai stato così divertente! I giochi di cucina di Pizza introduce il mondo della cucina, della cottura al forno e della pizza in un gioco divertente e creativo per i bambini.','2013-02-20',0.99,'34517460522');
